import logo from './heroimage@2x.png';
import { Typography, Grid } from './Components';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Grid container className="actionItems" spacing={3}>
          <img src={logo} alt="logo2" width="1920" height="1080" class="heroImage" />
          <p noWrap className="actionItem">Chargebee</p>
          {["Product", "Pricing", "Solutions", "Customers", "Resources"].map(label => (
            <Grid item>
              <p noWrap className="actionItem">{label}</p>
            </Grid>
          ))}
        </Grid>
        <img src={logo} alt="logo2" width="1920" height="1080" class="heroImage" />
      </header>
    </div>
  );
}

export default App;
